import { useState } from 'react';
import './App.css';

function App() {
  const[password,setPassword] = useState()
  const handlesubmit=(e)=>{
     setPassword(e.target.value)

  }
  return (
    <div className="App">
      <div className='container'> 
      <form>
      <input placeholder='enter password' type= "text" value={password} onChange={handlesubmit}/>
      <button >submit</button>


      </form>
      </div>
       <span className='output'>Output :{password} </span>
    </div>
  );
}

export default App;
